import React from 'react'
import { Redirect, Route } from 'react-router'

export const PrivateRoutes = ({
    someCheckpoint,
    component: Component,
    /* ...rest */
}) => {
    return (
        <Route { ...rest }
            component={ ( props ) => (
                ( someCheckpoint )
                    ? <Component { ...props } />
                    : <Redirect to="./" />
            )}
        />
    )
}
